    function getPackArrays(
        uint256 packId
    ) 
        external 
        view 
        returns(
            uint256[] memory, 
            uint256[] memory, 
            uint256[] memory
        );
    function getItemWon(
        uint256 packId, 
        uint256 chanceValue
    ) 
        external 
        view 
        returns (uint256);
